import React from 'react';
import './AddBooks.css';
function AddBooks() {
  return (
    <div className = 'addBooks'>
      <h2>Add Books</h2>
      <form>
        <lable className = 'addBookName'>
          Title:
          <input className = 'addBookInput' type = 'text'/>
        </lable>
        <lable className = 'authorName'>
          Title:
          <input className = 'authorNameInput' type = 'text'/>
        </lable>
      </form>
    </div>
  )
}

export default AddBooks
